function SoftSkillItem({ name, logo, content }) {
    return (
      <div className="soft-skill-item">
        <img src={logo} alt={name} className="logo" />
        <h3>{name}</h3>
        <p>{content}</p>
      </div>
    );
  }
    
export default SoftSkillItem
